import {Box, Button, Typography} from "@mui/material";
import introImg from "./projects/IterativeDesign/asset/intro-image.jpeg";
import LaunchIcon from '@mui/icons-material/Launch';
import React from "react";
import * as Scroll from "react-scroll";

interface CardIterativeDesignProps {
    setWhichPage: React.Dispatch<React.SetStateAction<string>>
}




export default function ProjectCardWithContent(props: CardIterativeDesignProps) {
    let scroll    = Scroll.animateScroll;
    return (
        <Box>
            <Typography variant="h1">
                Iterative Redesign: Winno
            </Typography>
            <Typography variant="body1">
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime
                mollitia,
                molestiae quas vel sint commodi repudiandae consequuntur
                voluptatum laborum
                numquam blanditiis harum quisquam eius sed odit fugiat iusto
                fuga praesentium
                optio, eaque rerum! Provident similique accusantium nemo autem.
            </Typography>
            <Button variant="contained" onClick={() => {
                props.setWhichPage("project0");
                scroll.scrollToTop();
            }}>
                <Typography variant={"body1"}>
                    LEARN MORE
                </Typography>
                <LaunchIcon/>
            </Button>

            <Box component={"img"} src={introImg}
                 alt={"an image for the project: iterative design of Winno"}/>
        </Box>
    )
}
